Noteikumi:
reģistrācija jāveic gan trakerī, gan arī pokera klientā;
reģistrācija turnīram iespējama līdz 20:00;
spēlētājiem, kas neierodas uz spēli, bonusa punkti netiek atgriezti;
spēlētājam laicīgi atsakoties no spēles, visi bonusa punkti tiek atgriezti;
aizliegts spēlēt no vairākiem kontiem vienlaicīgi;
aizliegts spamot/floodot spēles laikā;
aizliegts izmantot necenzētus vārdus leksikā;
aizliegts vilcināt spēli ilgāk par 5min
